import React from 'react';
import { Link } from 'react-router-dom';
import FontAwesome from 'react-fontawesome';


const SidenavItems = () => {

    const items = [
        {   type:'navItem',
            icon:'home',
            text:'Home',
            link:'/',
            restricted:false
        },
        {   type:'navItem',
            icon:'file-text-o',
            text:'My Profile',
            link:'/user',
            restricted:false
        },
        {   type:'navItem',
            icon:'file-text-o',
            text:'Add Admins',
            link:'/user/register',
            restricted:false
        },
        {   type:'navItem',
            icon:'fa-sign-in',
            text:'Login',
            link:'/login',
            restricted:false
        },
        {   type:'navItem',
            icon:'file-text-o',
            text:'My Reviews',
            link:'/user/user-reviews',
            restricted:false
        },
        {   type:'navItem',
            icon:'file-text-o',
            text:'Add Reviews',
            link:'/user/add',
            restricted:false
        },
        {   type:'navItem',
            icon:'fa-sign-out',
            text:'Logout',
            link:'/logout',
            restricted:false
        }
    ]


    const element = (item, i) => (
        <div>
            icon
        </div>
    )

    const showItems = () => {
        items.map((item, i) => {
            return element(item, i)
        })
    }


    return (
        <div>
            {showItems()}
        </div>
    );
};

export default SidenavItems;
